 /*_______________________________________________________________________________
 
 Method Tasks: 
 Set the resource Chart inscriptions from name to label on the objects. 
 To use it, insert this method beside the Chart. Then D&D the Chart onto the method.
 _________________________________________________________________________________
 Parameters	: none
 			  
 ReturnValues: none
 
 Called By	: D&D action Chart on this method
 Calls		: 
 
 Author		: Ralph Bauknecht
 Date		: 14.02.2019
 _________________________________________________________________________________
 	History: 
 Date	Author	Description
 _________________________________________________________________________________*/
 param chartobj : object
 
 -- Resource Chart
 for var i := 1 to chartobj.InputChannels.XDimIndex -- all entries of the chart table
 	if existsObject(chartobj.InputChannels[i, 0]) -- check if this is an object
 		var obj : object := chartobj.InputChannels[i, 0]
 		chartobj.InputChannels[i, 0] := obj.Label -- set the header entry to the label of the object
 	end
 next
 
 -- Buffer Chart
 for var i := 1 to chartobj.InputChannels.YDimIndex -- all entries of the chart table
 	if existsObject(chartobj.InputChannels[0, i]) -- check if this is an object
 		obj := chartobj.InputChannels[0, i]
 		chartobj.InputChannels[0, i] := obj.Label -- set the header entry to the label of the object
 	end
 next
 
 if chartobj.Active
 	chartobj.Active := FALSE
 	chartobj.Active := TRUE
 end
